import React from "react";
import Header from "./Section/Header";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const LandingPage = () => {
  return (
    <>
    <Router>
      
    </Router>
      <Routes>
        <Route path="/" element={<Header />} />
        
      </Routes>
    </>
  );
};

export default LandingPage;
